import React from "react";
import {NavLink} from 'react-router-dom'
//import {Link} from "react-router-dom";

import './App.css'
const Nav = ()=>{
return(
    <div className="navbar"> 
       <div className="container">
  
<ul><NavLink exact to = "/Home" className="logo-1" >Home</NavLink></ul>
    <ul><NavLink to = "/About" className="logo-2" >About</NavLink></ul>
   <ul><NavLink activeClassName = "selected" to ="/blog">Blog</NavLink></ul>  
    </div>
    </div>
);
}
export default Nav;
